import style from './TaskPage.module.css';
import { Link } from 'react-router-dom';

const TaskPage = () => {

    return (
        <div className={style['task-page']}>
            <Link to={'/'}>Main</Link>
            <Link to={'/register'}>register</Link>
            <Link to={'/login'}>login</Link>
            <Link to={'/task'}>task</Link>

            <h1>task</h1>

        </div>
    );
};

export default TaskPage;
